import VueRouter from 'vue-router'
import SortPage from '../views/Sort.vue'
import HomePage from '../components/HomePage.vue'
import DetailName from '../details/Detail.vue'
import BusName from '../store_bus/Bus.vue'
import BeSure from '../store_bus/BeSure.vue'
import PersonalCenter from '../user/user.vue'

export default new VueRouter({
    routes:[
        {
           path:'/',
           name:'home',
           component:HomePage,
        },
        {
            path:'/sort',
            name:'sort',
            component:SortPage,
            props($router) {
                return {
                  title: $router.params.title,
                }
            }
        },
        {
            path:'/detail/:title/:price/:id',
            name:'detail',
            component:DetailName,
            props($router) {
                return {
                  price: $router.params.price,
                  title: $router.params.title,
                  id:$router.params.id
                }
            }
        },
        {
            path:'/bus',
            name:'bus',
            component:BusName,

        },
        {
            path:'/order',
            name:'order',
            component:BeSure
        },
        {
            path:'/personalcenter/:title',
            name:'personalcenter',
            component:PersonalCenter,
            props($router) {
                return {
                  title: $router.params.title,
                }
            }
        }
    ]
})
